import React, { Component } from "react";
import {
  Route,
  NavLink,
  BrowserRouter
  } from "react-router-dom";


import Home from './components/Home';
import Faq from './components/Faq';
import Image from './components/Image';   
import Download from './components/Download';
import Statistics from './components/Statistics';

class App extends Component {
  render() {
    return (
      <BrowserRouter>

      <ul class="nav navbar-nav navbar-right"><li class="navbar-twitter"><a href="https://twitter.com/telegram" target="_blank" data-track="Follow/Twitter" onclick="trackDlClick(this, event)">
          <i class="icon icon-twitter"></i><span class="hidden-xs"> Twitter</span></a></li></ul>
      <div className="header">
      <ul className="nav">
        <li><NavLink exact to="/">Home</NavLink></li>
        <li><NavLink to="/faq">Faq</NavLink></li>
        <li><NavLink to="/images">Image</NavLink></li>
        <li><NavLink to="/download">Download</NavLink></li>
        <li><NavLink to="/statistics">Statistics</NavLink></li>
      </ul>
      </div>
      <hr />  
      </BrowserRouter>
    );
  }
}

export default App;
